INSERT dbo.RULES(ID_RULE, NAME, CONTENT, CREATED_DATE, MANAGER) VALUES (N'R6499', N'Không nấu nướng, giặt là trong phòng nghỉ', N'Quý khách vui lòng xuất trình hộ chiếu hoặc chứng minh nhân dân để làm thủ tục nhận phòng tại Lễ tân.', '2017-02-07 00:00:01.000', 'EMP51')
INSERT dbo.RULES(ID_RULE, NAME, CONTENT, CREATED_DATE, MANAGER) VALUES (N'R3628', N'Không thay đổi phòng hoặc đưa thêm người vào phòng khi chưa đăng ký trước với Lễ', N'
Không thay đổi, di chuyển đồ đạc trong phòng hoặc từ phòng này sang phòng khác. Trường hợp tài sản, đồ dùng trong phòng bị mất, hỏng do chủ quan Quý khách sẽ phải bồi thường 100% giá trị', '2018-06-30 07:52:34.000', 'EMP92')
INSERT dbo.RULES(ID_RULE, NAME, CONTENT, CREATED_DATE, MANAGER) VALUES (N'R2864', N'Không thay đổi, di chuyển đồ đạc trong phòng', N'
Khi ra khỏi phòng, Quý khách vui lòng rút thẻ chìa khoá ra khỏi ổ điện và gửi tại quầy lễ tân.Điện trong phòng sẽ tự động ngắt khi cửa đã được khép.', '2017-02-16 17:50:31.000', 'EMP30')
INSERT dbo.RULES(ID_RULE, NAME, CONTENT, CREATED_DATE, MANAGER) VALUES (N'R4064', N'Không mang súng đạn, chất cháy nổ, chất độc hại, các chất gây nghiện, vật nuôi h', N'
Không thay đổi, di chuyển đồ đạc trong phòng hoặc từ phòng này sang phòng khác. Trường hợp tài sản, đồ dùng trong phòng bị mất, hỏng do chủ quan Quý khách sẽ phải bồi thường 100% giá trị', '2018-06-28 06:29:43.000', 'EMP92')
INSERT dbo.RULES(ID_RULE, NAME, CONTENT, CREATED_DATE, MANAGER) VALUES (N'R3209', N'Xuất trình hộ chiếu hoặc chứng minh nhân dân để làm thủ tục nhận phòng tại Lễ tâ', N'Nếu Quý khách phát hiện có hiện tượng cháy trong Khách sạn, xin khẩn trương tìm cách thông báo cho người ở khu vực gần nhất và bình tĩnh làm theo chỉ dẫn phòng chống cháy nổ', '2018-01-22 13:25:20.000', 'EMP21')
INSERT dbo.RULES(ID_RULE, NAME, CONTENT, CREATED_DATE, MANAGER) VALUES (N'R1770', N'Khách sạn chỉ chịu trách nhiệm với những tài sản hoặc tiền được gửi tại quầy Lễ ', N'
Thời gian trả phòng là 12h30, nếu muộn hơn sẽ phải thanh toán thêm phụ phí tương ứng. Trong trường hợp cần thiết, xin vui lòng liên hệ với Lễ tân.', '2017-04-06 15:06:31.000', 'EMP20')
GO

